import { useSelector, useDispatch } from 'react-redux'
import styled from 'styled-components'
import Cat, { Button } from '../cat'
import Cart from '../cart'
import { useEffect, useState } from 'react'
import { ADDDATA, ADDCATEGORIES, INCREMENTCATDATA } from "../../store/action"
export default function Home() {
    const state = useSelector((store: any) => store.cats)
    console.log("ðŸš€ ~ file: index.tsx ~ line 9 ~ Home ~ state", state)
    const dispatch = useDispatch()
    const [data, setData] = useState()
    const [catData, setCatData] = useState()
    const [otherCatData, setOtherCatData] = useState()
    let pageNumber = 1
    useEffect(() => {
        fetch("https://api.thecatapi.com/v1/categories")
            .then((response: any) => {
                if (response.ok) {
                    // const data: object = (response.json())
                    // console.log("ðŸš€ ~ file: index.tsx ~ line 16 ~ .then ~ data", data)
                    return response.json()
                }
                throw response
            })
            .then((data: any) => {
                setData(data)
            })
            .catch(error => {
                console.log("Throw new error", error);
            })
        fetch("https://api.thecatapi.com/v1/images/search?limit=10&page=1&category_ids=1")
            .then((response: any) => {
                if (response.ok) {
                    return response.json()
                }
                throw response
            })
            .then((data: any) => {
                setCatData(data)
            })
            .catch(error => {
                console.log("Throw new error", error);
            })
    }, [])
    dispatch({ type: ADDCATEGORIES, data })
    dispatch({ type: ADDDATA, catData })
    console.log("ðŸš€ ~ file: index.tsx ~ line 11 ~ Home ~ data", data)
    console.log("ðŸš€ ~ file: index.tsx ~ line 11 ~ Home ~ cat data", catData)
    const click = () => {
        pageNumber = pageNumber + 1
        fetch(`https://api.thecatapi.com/v1/images/search?limit=10&page=${pageNumber}&category_ids=1`)
            .then((response: any) => {
                if (response.ok) {
                    return response.json()
                }
                throw response
            })
            .then((data: any) => {
                setOtherCatData(data)
            })
            .catch(error => {
                console.log("Throw new error", error);
            })
        dispatch({ type: INCREMENTCATDATA, data: otherCatData })
    }
    return (
        <>
            <Container>
                <Cart />
                {
                    state?.map((a: any) => (
                        <Cat key={a.id} id={a.id} image={a.url} />
                    ))
                }
            </Container>
            <Button onClick={click} width={200}>Load more...</Button>
        </>
    )
}

const Container = styled.div`
    display: flex;
    flex-wrap: wrap;
    justify-content: left;
    align-items: center;
    width: 100%;
    max-width: 1324px;
    padding: 40px 0;
    margin: auto;
`
